import React from "react";
import { AppBar, Toolbar, styled } from "@mui/material";
import './nav-bar.css';

const Header = styled(AppBar)`
    background: #111444
`

const Tabs = styled('p')`
    font-size: 20px
`

const NavBar = () => {
    return (
        <Header>
            <Toolbar>
                <Tabs>Code for interview </Tabs>
                <Tabs>All User</Tabs>
                <Tabs>Add user</Tabs>
            </Toolbar>
        </Header>
    )
}

export default NavBar;
